import React from 'react';
import {FaCheckDouble} from 'react-icons/fa';

const NavBar = () => {
    return(
        <nav class="navbar mb-5 py-1">
            <a class="navbar-brand m-0 p-0" href="#">do.ly<FaCheckDouble /></a>
            <button class="btn mr-2">Log Out</button>
        </nav>
    )
}

export default NavBar
